const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls, InnerBlocks } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  RangeControl
} = wp.components;

registerBlockType("gb/fullwidthwithverticalimages", {
  title: __("Full Width With Vertical Images", "GB"),
  icon: (
    <img src="data:image/jpeg;base64," />
  ),
  category: "team",
  attributes: {
    columns: { type: "number", default: 6 },
    contentUA: { 
      type: "string",
      default: "Meet our leadership"
    }
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    
    const onChangeColumns = (newColumns) => {
      setAttributes({ columns: newColumns });
  };

  const template = Array.from(Array(attributes.columns).keys()).map((i) => [
    "gb/teammembergrid",
  ]);

  const allowedBlocks = ["gb/teammembergrid"];

    return (
      <div className="bg-white">

           <InspectorControls>
        <PanelBody title="Block settings">
          <PanelRow>
            <b>Team members</b>
          </PanelRow>
          <PanelRow>
            <RangeControl
                label="Columns"
                value={attributes.columns}
                onChange={(value) => onChangeColumns(value)}
                min={1}
                max={30}
            />
          </PanelRow>
        </PanelBody>
      </InspectorControls>
        <div className="mx-auto py-12 px-4 max-w-7xl sm:px-6 lg:px-8 lg:py-24">
          <div className="space-y-12">
            <h2 className="text-3xl font-extrabold tracking-tight sm:text-4xl">
              <RichText
                value={attributes.contentUA}
                default={"Meet our leadership"}
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </h2>
            <ul
              role="list"
              className="space-y-12 lg:grid lg:grid-cols-2 lg:items-start lg:gap-x-8 lg:gap-y-12 lg:space-y-0"
            >
              <InnerBlocks
                    template={template}
                    templateLock="all"
                    allowedBlocks={allowedBlocks}
                />
            </ul>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;

    return (
      <div class="bg-white">
        <div class="mx-auto py-12 px-4 max-w-7xl sm:px-6 lg:px-8 lg:py-24">
          <div class="space-y-12">
            <h2 class="text-3xl font-extrabold tracking-tight sm:text-4xl">
             <RichText.Content value={attributes.contentUA}/>
            </h2>
            <ul
              role="list"
              class="space-y-12 lg:grid lg:grid-cols-2 lg:items-start lg:gap-x-8 lg:gap-y-12 lg:space-y-0"
            >
              <InnerBlocks.Content></InnerBlocks.Content>
            </ul>
          </div>
        </div>
      </div>
    );
  },
});
